INSERT INTO `gen_template` VALUES (1222817622663983106, 'Controller.java', '${ClassName}Controller.java', 'package ${package}.modules.${moduleName}.controller<#if subModuleName??>.${subModuleName}</#if>;\r\n\r\nimport ${package}.common.annotation.LogOperation;\r\nimport ${package}.common.constant.Constant;\r\nimport ${package}.common.page.PageData;\r\nimport ${package}.common.utils.ExcelUtils;\r\nimport ${package}.common.utils.Result;\r\nimport ${package}.common.validator.AssertUtils;\r\nimport ${package}.common.validator.ValidatorUtils;\r\nimport ${package}.common.validator.group.AddGroup;\r\nimport ${package}.common.validator.group.DefaultGroup;\r\nimport ${package}.common.validator.group.UpdateGroup;\r\nimport ${package}.modules.${moduleName}.dto<#if subModuleName??>.${subModuleName}</#if>.${ClassName}DTO;\r\nimport ${package}.modules.${moduleName}.excel<#if subModuleName??>.${subModuleName}</#if>.${ClassName}Excel;\r\nimport ${package}.modules.${moduleName}.service<#if subModuleName??>.${subModuleName}</#if>.${ClassName}Service;\r\nimport io.swagger.annotations.Api;\r\nimport io.swagger.annotations.ApiImplicitParam;\r\nimport io.swagger.annotations.ApiImplicitParams;\r\nimport io.swagger.annotations.ApiOperation;\r\nimport org.apache.shiro.authz.annotation.RequiresPermissions;\r\nimport org.springframework.beans.factory.annotation.Autowired;\r\nimport org.springframework.web.bind.annotation.*;\r\nimport springfox.documentation.annotations.ApiIgnore;\r\n\r\nimport javax.servlet.http.HttpServletResponse;\r\nimport java.util.List;\r\nimport java.util.Map;\r\n\r\n\r\n/**\r\n* ${tableComment}\r\n*\r\n* @author ${author} ${email}\r\n* @since ${version} ${date}\r\n*/\r\n@RestController\r\n@RequestMapping(\"${moduleName}/${classname}\")\r\n@Api(tags=\"${tableComment}\")\r\npublic class ${ClassName}Controller {\r\n    @Autowired\r\n    private ${ClassName}Service ${className}Service;\r\n\r\n    @GetMapping(\"page\")\r\n    @ApiOperation(\"\")\r\n    @ApiImplicitParams({\r\n        @ApiImplicitParam(name = Constant.PAGE, value = \"1\", paramType = \"query\", required = true, dataType=\"int\") ,\r\n        @ApiImplicitParam(name = Constant.LIMIT, value = \"\", paramType = \"query\",required = true, dataType=\"int\") ,\r\n        @ApiImplicitParam(name = Constant.ORDER_FIELD, value = \"\", paramType = \"query\", dataType=\"String\") ,\r\n        @ApiImplicitParam(name = Constant.ORDER, value = \"(ascdesc)\", paramType = \"query\", dataType=\"String\")\r\n    })\r\n    @RequiresPermissions(\"${moduleName}:${classname}:page\")\r\n    public Result<PageData<${ClassName}DTO>> page(@ApiIgnore @RequestParam Map<String, Object> params){\r\n        PageData<${ClassName}DTO> page = ${className}Service.page(params);\r\n\r\n        return new Result<PageData<${ClassName}DTO>>().ok(page);\r\n    }\r\n\r\n    @GetMapping(\"{id}\")\r\n    @ApiOperation(\"\")\r\n    @RequiresPermissions(\"${moduleName}:${classname}:info\")\r\n    public Result<${ClassName}DTO> get(@PathVariable(\"id\") Long id){\r\n        ${ClassName}DTO data = ${className}Service.get(id);\r\n\r\n        return new Result<${ClassName}DTO>().ok(data);\r\n    }\r\n\r\n    @PostMapping\r\n    @ApiOperation(\"\")\r\n    @LogOperation(\"\")\r\n    @RequiresPermissions(\"${moduleName}:${classname}:save\")\r\n    public Result save(@RequestBody ${ClassName}DTO dto){\r\n        //\r\n        ValidatorUtils.validateEntity(dto, AddGroup.class, DefaultGroup.class);\r\n\r\n        ${className}Service.save(dto);\r\n\r\n        return new Result();\r\n    }\r\n\r\n    @PutMapping\r\n    @ApiOperation(\"\")\r\n    @LogOperation(\"\")\r\n    @RequiresPermissions(\"${moduleName}:${classname}:update\")\r\n    public Result update(@RequestBody ${ClassName}DTO dto){\r\n        //\r\n        ValidatorUtils.validateEntity(dto, UpdateGroup.class, DefaultGroup.class);\r\n\r\n        ${className}Service.update(dto);\r\n\r\n        return new Result();\r\n    }\r\n\r\n    @DeleteMapping\r\n    @ApiOperation(\"\")\r\n    @LogOperation(\"\")\r\n    @RequiresPermissions(\"${moduleName}:${classname}:delete\")\r\n    public Result delete(@RequestBody Long[] ids){\r\n        //\r\n        AssertUtils.isArrayEmpty(ids, \"id\");\r\n\r\n        ${className}Service.delete(ids);\r\n\r\n        return new Result();\r\n    }\r\n\r\n    @GetMapping(\"export\")\r\n    @ApiOperation(\"\")\r\n    @LogOperation(\"\")\r\n    @RequiresPermissions(\"${moduleName}:${classname}:export\")\r\n    public void export(@ApiIgnore @RequestParam Map<String, Object> params, HttpServletResponse response) throws Exception {\r\n        List<${ClassName}DTO> list = ${className}Service.list(params);\r\n\r\n        ExcelUtils.exportExcelToTarget(response, null, \"${tableComment}\", list, ${ClassName}Excel.class);\r\n    }\r\n\r\n}', '${backendPath}/src/main/java/${packagePath}/modules/${moduleName}/controller/${subModuleName!}', 0, '2021-12-01 18:20:27');
INSERT INTO `gen_template` VALUES (1304292858898309122, 'list.vue', '${classname}.vue', '<template>\r\n  <el-card shadow=\"never\" class=\"aui-card--fill\">\r\n    <div class=\"mod-${moduleName}__${classname}\">\r\n      <el-form :inline=\"true\" :model=\"dataForm\" @keyup.enter.native=\"getDataList()\">\r\n      <#list columnList as column>\r\n      <#if column.query>\r\n        <el-form-item>\r\n        <#if column.formType == \'text\' || column.formType == \'textarea\' || column.formType == \'editor\'>\r\n          <el-input v-model=\"dataForm.${column.attrName}\" placeholder=\"${column.comment!}\" clearable></el-input>\r\n        <#elseif column.formType == \'select\'>\r\n          <#if column.dictName??>\r\n          <ren-select v-model=\"dataForm.${column.attrName}\" dict-type=\"${column.dictName}\" placeholder=\"${column.comment!}\"></ren-select>\r\n          <#else>\r\n          <el-select v-model=\"dataForm.${column.attrName}\" placeholder=\"${column.comment!}\">  \r\n            <el-option label=\"\" value=\"0\"></el-option>\r\n          </el-select>\r\n          </#if>\r\n        <#elseif column.formType == \'radio\'>\r\n          <#if column.dictName??>\r\n          <ren-radio-group v-model=\"dataForm.${column.attrName}\" dict-type=\"${column.dictName}\"></ren-radio-group>\r\n          <#else>\r\n          <el-radio-group v-model=\"dataForm.${column.attrName}\">\r\n            <el-radio :label=\"0\"></el-radio>\r\n          </el-radio-group>\r\n          </#if>\r\n        <#elseif column.formType == \'date\'>\r\n          <el-date-picker\r\n            v-model=\"daterange\"\r\n            type=\"daterange\"\r\n            value-format=\"yyyy-MM-dd\"\r\n            :range-separator=\"$t(\'datePicker.range\')\"\r\n            :start-placeholder=\"$t(\'datePicker.start\')\"\r\n            :end-placeholder=\"$t(\'datePicker.end\')\">\r\n          </el-date-picker>\r\n        <#elseif column.formType == \'datetime\'>\r\n          <el-date-picker\r\n            v-model=\"datetimerange\"\r\n            type=\"datetimerange\"\r\n            value-format=\"yyyy-MM-dd HH:mm:ss\"\r\n            :range-separator=\"$t(\'datePicker.range\')\"\r\n            :start-placeholder=\"$t(\'datePicker.start\')\"\r\n            :end-placeholder=\"$t(\'datePicker.end\')\">\r\n          </el-date-picker>\r\n        <#else>\r\n          <el-input v-model=\"dataForm.${column.attrName}\" placeholder=\"${column.comment!}\" clearable></el-input>\r\n        </#if>\r\n        </el-form-item>\r\n      </#if>\r\n      </#list>\r\n        <el-form-item>\r\n          <el-button @click=\"getDataList()\">{{ $t(\'query\') }}</el-button>\r\n        </el-form-item>\r\n        <el-form-item>\r\n          <el-button type=\"info\" @click=\"exportHandle()\">{{ $t(\'export\') }}</el-button>\r\n        </el-form-item>\r\n        <el-form-item>\r\n          <el-button v-if=\"$hasPermission(\'${moduleName}:${classname}:save\')\" type=\"primary\" @click=\"addOrUpdateHandle()\">{{ $t(\'add\') }}</el-button>\r\n        </el-form-item>\r\n        <el-form-item>\r\n          <el-button v-if=\"$hasPermission(\'${moduleName}:${classname}:delete\')\" type=\"danger\" @click=\"deleteHandle()\">{{ $t(\'deleteBatch\') }}</el-button>\r\n        </el-form-item>\r\n      </el-form>\r\n      <el-table v-loading=\"dataListLoading\" :data=\"dataList\" border @selection-change=\"dataListSelectionChangeHandle\" style=\"width: 100%;\">\r\n        <el-table-column type=\"selection\" header-align=\"center\" align=\"center\" width=\"50\"></el-table-column>\r\n<#list columnList as column>\r\n<#if column.list>\r\n    <#if column.dictName??>\r\n        <el-table-column prop=\"${column.attrName}\" label=\"${column.comment!}\" header-align=\"center\" align=\"center\">\r\n          <template slot-scope=\"scope\">\r\n            {{ $getDictLabel(\"${column.dictName}\", scope.row.${column.attrName}) }}\r\n          </template>\r\n        </el-table-column>\r\n    <#else>\r\n        <el-table-column prop=\"${column.attrName}\" label=\"${column.comment!}\" header-align=\"center\" align=\"center\"></el-table-column>\r\n    </#if>\r\n</#if>\r\n</#list>\r\n        <el-table-column :label=\"$t(\'handle\')\" fixed=\"right\" header-align=\"center\" align=\"center\" width=\"150\">\r\n          <template slot-scope=\"scope\">\r\n            <el-button v-if=\"$hasPermission(\'${moduleName}:${classname}:update\')\" type=\"text\" size=\"small\" @click=\"addOrUpdateHandle(scope.row.id)\">{{ $t(\'update\') }}</el-button>\r\n            <el-button v-if=\"$hasPermission(\'${moduleName}:${classname}:delete\')\" type=\"text\" size=\"small\" @click=\"deleteHandle(scope.row.id)\">{{ $t(\'delete\') }}</el-button>\r\n          </template>\r\n        </el-table-column>\r\n      </el-table>\r\n      <el-pagination\r\n        :current-page=\"page\"\r\n        :page-sizes=\"[10, 20, 50, 100]\"\r\n        :page-size=\"limit\"\r\n        :total=\"total\"\r\n        layout=\"total, sizes, prev, pager, next, jumper\"\r\n        @size-change=\"pageSizeChangeHandle\"\r\n        @current-change=\"pageCurrentChangeHandle\">\r\n      </el-pagination>\r\n      <!-- ,  /  -->\r\n      <add-or-update v-if=\"addOrUpdateVisible\" ref=\"addOrUpdate\" @refreshDataList=\"getDataList\"></add-or-update>\r\n    </div>\r\n  </el-card>\r\n</template>\r\n\r\n<script>\r\nimport mixinViewModule from \'@/mixins/view-module\'\r\nimport AddOrUpdate from \'./${classname}-add-or-update\'\r\nexport default {\r\n  mixins: [mixinViewModule],\r\n  data () {\r\n    return {\r\n      mixinViewModuleOptions: {\r\n        getDataListURL: \'/${moduleName}/${classname}/page\',\r\n        getDataListIsPage: true,\r\n        exportURL: \'/${moduleName}/${classname}/export\',\r\n        deleteURL: \'/${moduleName}/${classname}\',\r\n        deleteIsBatch: true\r\n      },\r\n      <#list columnList as column>\r\n      <#if column.query>\r\n      <#if column.formType == \'date\'>\r\n      daterange: null,\r\n      <#elseif column.formType == \'datetime\'>\r\n      datetimerange: null,\r\n      </#if>\r\n      </#if>\r\n    </#list>\r\n      dataForm: {\r\n        <#list columnList as column>\r\n        <#if column.query>\r\n        <#if column.formType == \'date\'>\r\n        startDate: \'\',\r\n        endDate: \'\',\r\n        <#elseif column.formType == \'datetime\'>\r\n        startDateTime: \'\',\r\n        endDateTime: \'\',\r\n        <#else>\r\n        ${column.attrName}: \'\',\r\n        </#if>\r\n        </#if>\r\n        </#list>\r\n      }\r\n    }\r\n  },\r\n  watch: {\r\n    <#list columnList as column>\r\n    <#if column.query>\r\n    <#if column.formType == \'date\'>\r\n    daterange (val) {\r\n      if (val == null) {\r\n        this.dataForm.startDate = null\r\n        this.dataForm.endDate = null\r\n      } else {\r\n        this.dataForm.startDate = val[0]\r\n        this.dataForm.endDate = val[1]\r\n      }\r\n    },\r\n    <#elseif column.formType == \'datetime\'>\r\n    datetimerange (val) {\r\n      if (val == null) {\r\n        this.dataForm.startDateTime = null\r\n        this.dataForm.endDateTime = null\r\n      } else {\r\n        this.dataForm.startDateTime = val[0]\r\n        this.dataForm.endDateTime = val[1]\r\n      }\r\n    },\r\n    </#if>\r\n    </#if>\r\n    </#list>\r\n  },\r\n  components: {\r\n    AddOrUpdate\r\n  }\r\n}\r\n</script>\r\n', '${frontendPath}/src/views/modules/${moduleName}', 0, '2021-12-01 18:20:27');
INSERT INTO `gen_template` VALUES (1304293015698169857, 'add-or-update.vue', '${classname}-add-or-update.vue', '<#assign editor=false/>\r\n<template>\r\n  <el-dialog :visible.sync=\"visible\" :title=\"!dataForm.${pk.attrName} ? $t(\'add\') : $t(\'update\')\" :close-on-click-modal=\"false\" :close-on-press-escape=\"false\">\r\n    <el-form :model=\"dataForm\" :rules=\"dataRule\" ref=\"dataForm\" @keyup.enter.native=\"dataFormSubmitHandle()\" :label-width=\"$i18n.locale === \'en-US\' ? \'120px\' : \'80px\'\">\r\n<#list columnList as column>\r\n  <#if column.form>\r\n      <#if column.formType == \'text\'>\r\n      <el-form-item label=\"${column.comment!}\" prop=\"${column.attrName}\">\r\n        <el-input v-model=\"dataForm.${column.attrName}\" placeholder=\"${column.comment!}\"></el-input>\r\n      </el-form-item>\r\n      <#elseif column.formType == \'textarea\'>\r\n      <el-form-item label=\"${column.comment!}\" prop=\"${column.attrName}\">\r\n        <el-input type=\"textarea\" v-model=\"dataForm.${column.attrName}\"></el-input>\r\n      </el-form-item>\r\n      <#elseif column.formType == \'editor\'>\r\n      <el-form-item label=\"${column.comment!}\" prop=\"${column.attrName}\">\r\n        <!-- ,  -->\r\n        <div id=\"J_quillEditor\"></div>\r\n        <!--  (element upload) -->\r\n        <el-upload\r\n          :action=\"uploadUrl\"\r\n          :show-file-list=\"false\"\r\n          :before-upload=\"uploadBeforeUploadHandle\"\r\n          :on-success=\"uploadSuccessHandle\"\r\n          style=\"display: none;\">\r\n          <el-button ref=\"uploadBtn\" type=\"primary\" size=\"small\">{{ $t(\'upload.button\') }}</el-button>\r\n        </el-upload>\r\n      </el-form-item>\r\n      <#assign editor=true/>\r\n      <#assign editorName=\"${column.attrName}\"/>\r\n      <#elseif column.formType == \'select\'>\r\n      <#if column.dictName??>   \r\n      <el-form-item label=\"${column.comment!}\" prop=\"${column.attrName}\">\r\n        <ren-select v-model=\"dataForm.${column.attrName}\" dict-type=\"${column.dictName}\" placeholder=\"${column.comment!}\"></ren-select>\r\n      </el-form-item>\r\n      <#else>\r\n      <el-form-item label=\"${column.comment!}\" prop=\"${column.attrName}\">\r\n        <el-select v-model=\"dataForm.${column.attrName}\" placeholder=\"\">\r\n          <el-option label=\"\" value=\"0\"></el-option>\r\n        </el-select>\r\n      </el-form-item>\r\n      </#if>\r\n      <#elseif column.formType == \'radio\'>\r\n      <#if column.dictName??>   \r\n      <el-form-item label=\"${column.comment!}\" prop=\"${column.attrName}\">\r\n        <ren-radio-group v-model=\"dataForm.${column.attrName}\" dict-type=\"${column.dictName}\"></ren-radio-group>\r\n      </el-form-item>\r\n      <#else>\r\n      <el-form-item label=\"${column.comment!}\" prop=\"${column.attrName}\">\r\n        <el-radio-group v-model=\"dataForm.${column.attrName}\">\r\n          <el-radio :label=\"0\"></el-radio>\r\n          <el-radio :label=\"1\"></el-radio>\r\n        </el-radio-group>\r\n      </el-form-item>\r\n      </#if>\r\n      <#elseif column.formType == \'checkbox\'>\r\n      <el-form-item label=\"${column.comment!}\" prop=\"${column.attrName}\">\r\n        <el-checkbox-group v-model=\"dataForm.${column.attrName}\">\r\n          <el-checkbox label=\"\" name=\"type\"></el-checkbox>\r\n          <el-checkbox label=\"\" name=\"type\"></el-checkbox>\r\n        </el-checkbox-group>\r\n      </el-form-item>\r\n      <#elseif column.formType == \'date\'>\r\n      <el-form-item label=\"${column.comment!}\" prop=\"${column.attrName}\">\r\n        <el-date-picker type=\"date\" placeholder=\"${column.comment!}\" value-format=\"yyyy-MM-dd\" v-model=\"dataForm.${column.attrName}\"></el-date-picker>\r\n      </el-form-item>\r\n      <#elseif column.formType == \'datetime\'>\r\n      <el-form-item label=\"${column.comment!}\" prop=\"${column.attrName}\">\r\n        <el-date-picker type=\"datetime\" placeholder=\"${column.comment!}\" value-format=\"yyyy-MM-dd HH:mm:ss\" v-model=\"dataForm.${column.attrName}\"></el-date-picker>\r\n      </el-form-item>\r\n      <#else>\r\n      <el-form-item label=\"${column.comment!}\" prop=\"${column.attrName}\">\r\n        <el-input v-model=\"dataForm.${column.attrName}\" placeholder=\"${column.comment!}\"></el-input>\r\n      </el-form-item>\r\n      </#if>\r\n  </#if>\r\n</#list>\r\n    </el-form>\r\n    <template slot=\"footer\">\r\n      <el-button @click=\"visible = false\">{{ $t(\'cancel\') }}</el-button>\r\n      <el-button type=\"primary\" @click=\"dataFormSubmitHandle()\">{{ $t(\'confirm\') }}</el-button>\r\n    </template>\r\n  </el-dialog>\r\n</template>\r\n\r\n<script>\r\nimport debounce from \'lodash/debounce\'\r\n<#if editor>\r\nimport Cookies from \'js-cookie\'\r\nimport \'quill/dist/quill.snow.css\'\r\nimport Quill from \'quill\'\r\n</#if>\r\nexport default {\r\n  data () {\r\n    return {\r\n      visible: false,\r\n      <#if editor>\r\n      quillEditor: null,\r\n      quillEditorToolbarOptions: [\r\n        [\'bold\', \'italic\', \'underline\', \'strike\'],\r\n        [\'blockquote\', \'code-block\', \'image\'],\r\n        [{ \'header\': 1 }, { \'header\': 2 }],\r\n        [{ \'list\': \'ordered\' }, { \'list\': \'bullet\' }],\r\n        [{ \'script\': \'sub\' }, { \'script\': \'super\' }],\r\n        [{ \'indent\': \'-1\' }, { \'indent\': \'+1\' }],\r\n        [{ \'direction\': \'rtl\' }],\r\n        [{ \'size\': [\'small\', false, \'large\', \'huge\'] }],\r\n        [{ \'header\': [1, 2, 3, 4, 5, 6, false] }],\r\n        [{ \'color\': [] }, { \'background\': [] }],\r\n        [{ \'font\': [] }],\r\n        [{ \'align\': [] }],\r\n        [\'clean\']\r\n      ],\r\n      uploadUrl: \'\',\r\n      </#if>\r\n      dataForm: {\r\n<#list columnList as column>\r\n        ${column.attrName}: \'\',\r\n</#list>\r\n      }\r\n    }\r\n  },\r\n  computed: {\r\n    dataRule () {\r\n      <#if editor>\r\n      const validate${editorName} = (rule, value, callback) => {\r\n        if (this.quillEditor.getLength() <= 1) {\r\n          return callback(new Error(this.$t(\'validate.required\')))\r\n        }\r\n        callback()\r\n      }\r\n      </#if>\r\n      return {\r\n<#list columnList as column>\r\n<#if column.form && column.required>\r\n        <#if editor && column.attrName == editorName>\r\n        ${column.attrName}: [\r\n          { required: true, message: this.$t(\'validate.required\'), trigger: \'blur\' },\r\n          { validator: validate${editorName}, trigger: \'blur\' }\r\n        ],\r\n        <#else>\r\n        ${column.attrName}: [\r\n          { required: true, message: this.$t(\'validate.required\'), trigger: \'blur\' }\r\n        ],\r\n        </#if>\r\n</#if>\r\n</#list>\r\n      }\r\n    }\r\n  },\r\n  methods: {\r\n    init () {\r\n      this.visible = true\r\n      this.$nextTick(() => {\r\n        <#if editor>\r\n        if (this.quillEditor) {\r\n          this.quillEditor.deleteText(0, this.quillEditor.getLength())\r\n        } else {\r\n          this.quillEditorHandle()\r\n        }\r\n        </#if>\r\n        this.$refs[\'dataForm\'].resetFields()\r\n        if (this.dataForm.${pk.attrName}) {\r\n          this.getInfo()\r\n        }\r\n      })\r\n    },\r\n    // \r\n    getInfo () {\r\n      this.$http.get(\'/${moduleName}/${classname}/\' + this.dataForm.${pk.attrName}).then(({ data: res }) => {\r\n        if (res.code !== 0) {\r\n          return this.$message.error(res.msg)\r\n        }\r\n        this.dataForm = {\r\n          ...this.dataForm,\r\n          ...res.data\r\n        }\r\n        <#if editor>\r\n        this.quillEditor.root.innerHTML = this.dataForm.${editorName}\r\n        </#if>\r\n      }).catch(() => {})\r\n    },\r\n    <#if editor>\r\n    // \r\n    quillEditorHandle () {\r\n      this.quillEditor = new Quill(\'#J_quillEditor\', {\r\n        modules: {\r\n          toolbar: this.quillEditorToolbarOptions\r\n        },\r\n        theme: \'snow\'\r\n      })\r\n      //  (element upload)\r\n      this.uploadUrl = window.SITE_CONFIG[\'apiURL\'] + \'/sys/oss/upload?token=\' + Cookies.get(\'token\')\r\n      this.quillEditor.getModule(\'toolbar\').addHandler(\'image\', () => {\r\n        this.$refs.uploadBtn.$el.click()\r\n      })\r\n      // \r\n      this.quillEditor.on(\'text-change\', () => {\r\n        this.dataForm.${editorName} = this.quillEditor.root.innerHTML\r\n      })\r\n    },\r\n    // \r\n    uploadBeforeUploadHandle (file) {\r\n      if (file.type !== \'image/jpg\' && file.type !== \'image/jpeg\' && file.type !== \'image/png\' && file.type !== \'image/gif\') {\r\n        this.$message.error(\'jpgpnggif\')\r\n        return false\r\n      }\r\n    },\r\n    // \r\n    uploadSuccessHandle (res, file, fileList) {\r\n      if (res.code !== 0) {\r\n        return this.$message.error(res.msg)\r\n      }\r\n      this.quillEditor.insertEmbed(this.quillEditor.getSelection().index, \'image\', res.data.src)\r\n    },\r\n    </#if>\r\n    // \r\n    dataFormSubmitHandle: debounce(function () {\r\n      this.$refs[\'dataForm\'].validate((valid) => {\r\n        if (!valid) {\r\n          return false\r\n        }\r\n        this.$http[!this.dataForm.${pk.attrName} ? \'post\' : \'put\'](\'/${moduleName}/${classname}/\', this.dataForm).then(({ data: res }) => {\r\n          if (res.code !== 0) {\r\n            return this.$message.error(res.msg)\r\n          }\r\n          this.$message({\r\n            message: this.$t(\'prompt.success\'),\r\n            type: \'success\',\r\n            duration: 500,\r\n            onClose: () => {\r\n              this.visible = false\r\n              this.$emit(\'refreshDataList\')\r\n            }\r\n          })\r\n        }).catch(() => {})\r\n      })\r\n    }, 1000, { \'leading\': true, \'trailing\': false })\r\n  }\r\n}\r\n</script>\r\n', '${frontendPath}/src/views/modules/${moduleName}', 0, '2021-12-01 18:20:27');
